import React from 'react';
import bg from '../assets/landing/landingbg.png';
import '../styles/Community.css';


function Community() {
  return (
        <section id='community'>
          <div className="community_container">

              <div className="community_logo">
                  <div className="community_logo_comm">
                  </div>
                  <div className="community_mand_container">
                      <div className='community_rotating_mandala'>

                      </div>
                  </div>

              </div>
              <div className="community_description">
                  

              </div>
              <div className="community_bg">
              </div>
          </div>
        </section>
    
  )
}

export default Community;
